import React from "react";
import Slider from "./Slider";
import Card from "./Product";
import img from "../img/img1.jpg"
const Home=()=>{
    return(
        <>
        <Slider/>
        <div className="Container_products">
            <Card img= {img} title ="test" description="Lorem Ipsum is simply 55555555555555555555555555555555555555555555555555555555555555555555555555555 "/>
        </div>
        </>
    )
}
export default Home;
